import math from './resources/math.png';
import science from './resources/science.png';
import accomplishments from './resources/accomplishments.png';
import React from 'react';
import { withRouter } from "react-router-dom";
import { Redirect } from "react-router-dom";
import "./Header.css";
import home from './resources/home.png';
class Image extends React.Component{
    constructor(props){
        super(props);
        this.state = { redirect: null };
    }
    switch(){
        this.setState({ redirect: this.props.path});
    }
    render(){
        return(
            <img class="Image"  src={this.props.name}></img>
        );
    }
}
class Button extends React.Component{
    constructor(props){
        super(props);
        this.state = { redirect: null };
    }
    switch(){
        this.setState({ redirect: this.props.path});
    }
    render(){
        return(
            <button class="Button" onClick={()=>this.switch()}>
                <Image name={this.props.name} path={this.props.path}></Image>
            </button>
        );
    }
}
class Header extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <div className="Header">
                <Button name={home} path="/"><Image name={home} path="/"></Image></Button>
                <Button name={math} path="/Math"><Image name={math} path="/Math"></Image></Button>
                <Button name={science} path="/Science"><Image name={science} path="/Science"></Image></Button>
                <Button name={accomplishments} path="/Accomplishments"><Image name={accomplishments} path="/Accomplishments"></Image></Button>
            </div>
        );
    }
}
export default withRouter(Header);
